import React from 'react';
imp

const products = [
  { id: 1, title: 'Karambit', price: '$1845.83', img: '../SKINS/arma1.png' },
  { id: 2, title: 'M9 Bayoneta', price: '$1717.05', img: 'SKINS/arma2.png' },
  { id: 3, title: 'Black Lotus', price: 'Ver', img: 'SKINS/arma3.png' },
  { id: 4, title: 'Desert Eagle', price: 'Ver', img: 'SKINS/arma4.png' },
  { id: 5, title: 'Emperatriz', price: 'Ver', img: 'SKINS/arma5.png' },
  { id: 6, title: 'Nightmare', price: 'Ver', img: 'SKINS/arma6.png' },
  { id: 7, title: 'Print Stream', price: 'Ver', img: 'SKINS/arma7.png' },
  { id: 8, title: 'Nightwish', price: 'Ver', img: 'SKINS/arma8.png' },
  { id: 9, title: 'Blue Laminate', price: 'Ver', img: 'SKINS/arma9.png' },
  { id: 10, title: 'Decimator', price: 'Ver', img: 'SKINS/arma10.png' },
  { id: 11, title: 'Fade', price: '$949.99', img: 'SKINS/arma11.png' },
  { id: 12, title: 'Mjölnir', price: '$800.05', img: 'SKINS/arma12.png' },
  // Agrega más productos según sea necesario
];

const ProductList = () => {
  return (
    <div className="tienda">
      {products.map(product => (
        <div className="item" key={product.id} onClick={() => alert(product.title)}>
          <img src={product.img} alt={product.title} className="item-image" />
          <p className="item-title">{product.title}</p>
          <p className="item-price">{product.price}</p>
        </div>
      ))}
    </div>
  );
};

export default ProductList;
